Mammalian reproduction The mammalian male reproductive system contains two main divisions, the penis and the testicles, the latter of which is where sperm are produced. In humans, both of these organs are outside the abdominal cavity, but they can be primarily housed within the abdomen in other animals. For instance, a dog's penis is covered by a penile sheath except when mating. Having the testicles outside the abdomen best facilitates temperature regulation of the sperm, which require specific temperatures to survive. The external location may also cause a reduction in the heat-induced contribution to the spontaneous mutation rate in male germinal tissue.[3] Sperm are the smaller of the two gametes and are generally very short-lived, requiring males to produce them continuously from the time of sexual maturity until death. The produced sperm are stored in the epididymis until ejaculation. The sperm cells are motile and they swim using tail-like flagella to propel themselves towards the ovum. The sperm follows temperature gradients (thermotaxis)[4] and chemical gradients (chemotaxis) to locate the ovum.differs ).")]
